import os, sysids = []for id in open("list.txt"):    single = True    id = id.rstrip('\n')    if id == "":        continue    for _id in ids:        if _id == id:            print(id + " is not single")            single = False    if single:        ids.append(id)print(ids)f = open("list.txt", "w")try:    for id in ids:        f.write(id + "\n")except:    passfinally:    f.close()    